import React from "react";
import { GrClear } from "react-icons/gr";
import { GrConfigure } from "react-icons/gr";


class User extends React.Component {
    el = this.props.user
    render() {
        return (<div className="user-div">
            <GrClear className="delete-icon"/>
            <GrConfigure className="edit-icon"/>
            <h2>{this.el.Name}</h2>
            <p>{this.el.Decription}</p>
            <p>{this.el.isHappy ? 'Суета' : 'Грусть'}</p>
        </div>)
    }
}

export default User
